import json
import csv
from collections import deque
from typing import Any

def flatten_dict(d: dict, parent_key: str = '', sep: str = '_') -> dict:
    items = []
    for k, v in d.items():
        new_key = f"{parent_key}{sep}{k}" if parent_key else k
        if isinstance(v, dict):
            items.extend(flatten_dict(v, new_key, sep=sep).items())
        elif isinstance(v, list):
            for i, item in enumerate(v):
                if isinstance(item, dict):
                    items.extend(flatten_dict(item, f"{new_key}_{i}", sep=sep).items())
                else:
                    items.append((f"{new_key}_{i}", item))
        else:
            items.append((new_key, v))
    return dict(items)

def process_json_and_write_to_csv(json_data: dict, output_file: str):
    # 展平 JSON 数据
    flattened_data = []
    queue = deque([json_data])
    while queue:
        current = queue.popleft()
        if isinstance(current, list):
            for item in current:
                queue.append(item)
        elif isinstance(current, dict):
            flattened = flatten_dict(current)
            flattened_data.append(flattened)
            for child in current.get('children', []):
                queue.append(child)

    # 按 id 排序
    sorted_data = sorted(flattened_data, key=lambda x: x['id'])

    # 写入 CSV 文件
    fieldnames = sorted(list(sorted_data[0].keys()))
    with open(output_file, 'w', newline='', encoding='utf-8') as csvfile:
        writer = csv.DictWriter(csvfile, fieldnames=fieldnames)
        writer.writeheader()
        for row in sorted_data:
            writer.writerow(row)

